import React, { Component } from 'react';
import { Row, Col, Pagination, PaginationItem, PaginationLink, Input } from 'reactstrap';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faAngleDoubleLeft, faAngleLeft, faAngleRight, faAngleDoubleRight } from '@fortawesome/free-solid-svg-icons';


class ObjPag extends Component {

    constructor(props) {
        super(props);
    }

    pagRender(e,value){
        const RegPerFind = this.props.info.RegPerFind;
        const NumPages = this.props.info.NumPages;
        const LimtPage = this.props.info.LimtPage;
        const NowPage = this.props.info.NowPage;
        var rendPage = 0;
        rendPage = (NumPages < 10)? NumPages : 10;
        const pag = [];

        for (let i=1; i<=rendPage; i++) {
            if(i == NowPage){
                pag.push(
                    <PaginationItem key={"pag"+i} active>
                        <PaginationLink onClick={this.props.pagLoad.bind(this,""+i)}>
                            {i}
                        </PaginationLink>
                    </PaginationItem>
                )
            }else{
                pag.push(
                    <PaginationItem key={"pag"+i}>
                        <PaginationLink onClick={this.props.pagLoad.bind(this,""+i)}>
                            {i}
                        </PaginationLink>
                    </PaginationItem>
                )
            }
        }
        return pag;
    }

   // registerChanged(e){
     //   console.log(e.target.value)
        //this.props.pagLoad.bind(this, "changeRegister", (event) => {return event} )
    //  }
    options(){
        const reg = [];

        if(this.props.info.LimtPage == "5") reg.push(<option key={"numReg5"} value="5" selected>5</option>);
        else reg.push(<option key={"numReg5"} value="5">5</option>);
        if(this.props.info.LimtPage == "10")reg.push(<option key={"numReg10"} value="10" selected>10</option>);
        else reg.push(<option key={"numReg10"} value="10">10</option>);
        if(this.props.info.LimtPage == "20")reg.push(<option key={"numReg20"} value="20" selected>20</option>);
        else reg.push(<option key={"numReg20"} value="20">20</option>);
        if(this.props.info.LimtPage == "50")reg.push(<option key={"numReg50"} value="50" selected>50</option>);
        else reg.push(<option key={"numReg50"} value="50">50</option>);
        if(this.props.info.LimtPage == "100")reg.push(<option key={"numReg100"} value="100" selected>100</option>);
        else reg.push(<option key={"numReg100"} value="100">100</option>);
        return reg;
    }

    render(){

        const propss = this.props.pagLoad.bind();

        return (
            <Row>
                <Col Col xs="2" md="2">
                    <Input type="select" name="select" id="pagNum" onChange={ 
                        (event) => {
                            const limit = event.target.value;
                            propss("cRegister",limit);
                        }
                    }>

                        {this.options()}
                    </Input>
                </Col>
                <Col Col xs="8" md="8">
                    <Pagination  >
                        <PaginationItem key="allback">
                            <PaginationLink onClick={this.props.pagLoad.bind(this, 'allback')}>
                                <FontAwesomeIcon  icon={faAngleDoubleLeft} />
                            </PaginationLink>
                        </PaginationItem>
                        <PaginationItem key="back">
                            <PaginationLink previous onClick={this.props.pagLoad.bind(this, "back")}>
                                <FontAwesomeIcon  icon={faAngleLeft} />
                            </PaginationLink>
                        </PaginationItem>

                        {this.pagRender()}

                        <PaginationItem key="forward">
                            <PaginationLink onClick={this.props.pagLoad.bind(this, "forward")}>
                                <FontAwesomeIcon  icon={faAngleRight} />
                            </PaginationLink>
                        </PaginationItem>
                        <PaginationItem key="allforward">
                            <PaginationLink previous onClick={this.props.pagLoad.bind(this, "allforward")}>
                                <FontAwesomeIcon  icon={faAngleDoubleRight} />
                            </PaginationLink>
                        </PaginationItem>
                    </Pagination>
                </Col>
            </Row>

        );
    }
}

export default ObjPag;
